import React from 'react';
import './App.css';
import Head from './UI/Head.jsx';
import Dash from './UI/Dash.jsx';
import Display from './UI/Display.jsx';
import Content from './UI/Content.jsx';

function App() {
  return (
    <div className="container-fluid">
       <div className="row">
       <Head/>
       <Dash/>
       </div>
       <Display/>
       <Content/>
    </div>
  );
}

export default App;
